import React, {Component} from 'react';

class Poster extends Component {
    constructor() {
        super();
        this.state={
            postData:"",
            postResult:""
        }
    }
    render() {
        return (
            <div>
                <input onChange={this.onChangeHandler} type="text"/>
                <button onClick={this.onClickHandler}>send post coms</button>
            </div>
        );
    }
}

export default Poster;
